
DROP TABLE IF EXISTS `world_quest`;
CREATE TABLE `world_quest` (
  `id` INT (10) UNSIGNED NOT NULL,
  `duration` INT (10) UNSIGNED NOT NULL,
  `variable` INT (10) NOT NULL,
  `value` INT (10) NOT NULL,
  `VerifiedBuild` SMALLINT(5) DEFAULT 0 NULL,
  PRIMARY KEY (`id`)
);

DROP TABLE IF EXISTS `world_quest_reward`;
CREATE TABLE `world_quest_reward`(
    `id` INT(11) UNSIGNED NOT NULL,
    `questType` MEDIUMINT(8) UNSIGNED NOT NULL,
    `rewardType` ENUM('ITEM','CURRENCY','GOLD') NOT NULL,
    `rewardId` INT(11) UNSIGNED NOT NULL,
    `rewardCount` INT(11),
    `rewardContext` INT(11) UNSIGNED DEFAULT 0 NOT NULL,
    PRIMARY KEY (`id`, `questType`, `rewardType`, `rewardId`)
);

DELETE FROM `world_quest`;

DELETE FROM `world_quest_reward`;

DELETE FROM `command` WHERE `name` = "list quests";

DELETE FROM `trinity_string` WHERE `entry` IN (11022, 11023);
